Speed Retouch from 1.5 hours down into 1.5 minutes ! It’s always interesting to see how much work I’m actually doing. And now that I’m looking at it, I see more things I <could> do but decided not to in order to achieve a more realistic and natural look. I used to like super retouched shots for myself but now I’m leaning towards a barely there look. Like perfectly real. 
.
Sidebar, these perfect earrings are from @anthropologie. I bought them for shoots but I think I may just go head and take them home for myself 😌
