"I want my photos to exude the same joy that I felt while taking them. I try to connect with everyone on my team and help them feel comfortable and happy so that the enjoyment shows through the work. I especially want the model to feel comfortable and taken care of and I constantly check in to see how they are doing and to see if they need anything. I want to see genuine joyful smiles on the models faces and an optimistic and carefree spark in their eyes and the only way to do that is to make sure that they are enjoying themselves at our shoots just as much as I am."

Thank you to Beauty and Product Photographer @taylorrbee for the stunning photos ❤️

