I’ve been taking a bit of a break from social media but I’m quickly popping in to toot my own horn. I have been really struggling with some things recently and I’ve been itching to put down some mile markers to track my progress forward. I recently noticed that one of my clients finally put my work on the Sephora sites and in stores all over the world. I had wanted to start moving towards working with mostly Sephora and Ulta tier clients for their headliner or product launches and not just social media fodder/evergreen content this year. I have 3 I’ve already worked with and 1 I’m on a year long retainer for. I think it’s a testimony towards my strategy of “always create personal content that you would like to be hired for”. I shot with products from all 4 of these clients for personal content and they ended up scouting me from that content. Day by day, step by step.
